During lock down this year, I, like most suffered with anxiety. I used my yogic tools as always, but this time needed more. What helped the most? Pranayama. specifically, slow, nasal breathing and breath retention on the exhale.

ğŸ‘„The subject of breath is HUGE SCIENCE so Iâ€™m keeping this post simple and specifically about mouth v nasal breathing and why I decided to tape my mouth at night.

ğŸ‘„The Downside of Mouth Breathing:
 *Breathing unfiltered air into the lungs
*Air isnâ€™t humidified
*Breath is often shallow and in the Upper chest
*Chronic over-breathing (another stress response)
*Greater incidence of snoring and sleep apnoea
*Bad breath, dental decay, gum disease
*Dysfunction of the jaw joint (TMJ disorder)
*Postural changes, specifically the â€˜head forward postureâ€™.

ğŸ‘„The Benefit of Nasal Breathing:
*Warms, moistens and the air
*Removes germs and bacteria
*Brings air deeper into the lungs
*Nasal breathing tends to be slower and deeper which activates the diaphragm
*Nitric Oxide is increased (NO is  a vasodilator, meaning it relaxes the inner muscles of your blood vessels, causing the vessels to widen)
*Helps prevent colds, flu, allergic reaction, hay fever, irritable coughing
*Facilitates correct action of the diaphragm
*Promotes activity of the parasympathetic nervous system, which calms and relaxes the body, slows the breathing and the heart and promotes digestion

ğŸ‘„One thing to bear in mind in that you need to nose breathe ALL THE TIME. If you breathe through the mouth at night, your undoing all what youâ€™ve achieved in the day!

ğŸ‘„Like anything new, it takes getting used to! Dedication and consistency is the key to success. Keep reminding yourself why youâ€™re doing it. Only you can make the change ğŸ˜Š

