The â€œPulse on the Nationâ€™s #nursesâ€ survey has found that 3 out of 4 #nurses responding to #COVID19 report difficulty sleeping. I feel this will surprise none of us in the #nursing profession, but it does mean that the data supports what any of us could tell the researchers.
â€¢â€¢â€¢â€¢â€¢â€¢
But what does it mean that nurses are having problems sleeping? #nursetired is known as #nursefatigue in the literature ğŸ˜´ & has been researched for a while. A great concern is - what kind of #patientcare do sleepy nurses provide? 
â€¢â€¢â€¢â€¢â€¢â€¢
The American Academy of Nurses actually published a position statement on #nursefatigue called â€œPosition statement: Reducing fatigue associated with sleep deficiency and work hours in nursesâ€œ where it states - â€œThe American Academy of Nursing recognizes that safe nursing practice requires health care providers obtaining sleep that is of high quality and adequate duration. Nurse fatigue poses a danger to patients because of increased risk of error, other people on the roads when tired nurses commute to and from work, and the health and safety of nurses themselves.â€ 
â€¢â€¢â€¢â€¢â€¢â€¢
This position statement goes on to recommend the following - ğŸ˜´ Urge nurses & employers of health care orgs to educate themselves about the health risks linked to shift work & long work hours & the EB strategies to reduce those risks. ğŸ˜´Urge employers of health care orgs to incorporate EBP in the design of their employees' work schedules & establish policies, practices, & systems at work that promote sleep health & an alert workforce. ğŸ˜´ Urge employers to promote a workplace culture that promotes sleep #health to achieve optimum functioning, health, #safety, & sense of #wellbeing of their workforce. ğŸ˜´Encourage employers to recognize the role of shift work, long shifts, & nurse fatigue on turnover, absenteeism, patient safety, & related costs. ğŸ˜´ Urge experts to develop CE courses that relay EBP personal & workplace interventions to maximize sleep health & alertness in nurses.
